import React from "react";
import styles from "./CSS/StatusInventory.module.css";
import { Droppable } from "react-beautiful-dnd";
import StatusIcon from "./StatusIcon";
import Status from "./Status";

class StatusInventory extends React.Component {
    constructor(props){
        super(props)
        this.state={
            statuses: []
        }

        this.state.statuses.push(new Status("test"));
        this.state.statuses.push(new Status("test2"));
        this.state.statuses.push(new Status("test3"));
    }

    renderStatusIcons(){
        let toRender = [];

        toRender.push();
    }

    render(){
        return(
            <Droppable droppableId="statusInventory">
                {(provided) => (
                        <ul className={styles.StatusInventory} {...provided.droppableProps} ref={provided.innerRef}>
                            {this.state.statuses.map((i, index) => {
                                return <StatusIcon key={i.id} draggableId={i.id} index={index}/>    
                            })}
                            {provided.placeholder}
                        </ul>
                    )
                }
            </Droppable>
        );
    }
}

export default StatusInventory;
